static void printRLEMaskFromBitmask(const uint8_t *mask, int length, int width) {
   Serial.println(F("static const uint8_t PROGMEM RLEMask[] = {"));

   int streak = 0;
   bool set = false;
   bool first = true;
   const int bytesPerRow = (width / 8.0) + 0.9; //Always tip to next biggest int
   for(int i = 0; i < length; i++) {
      uint8_t byte = pgm_read_byte(&mask[i]);

      for(int j = 0; j < 8; j++) {
         if(((i%(bytesPerRow)) * 8) + j == width) {
            //Padding bits have been reachedm, don't count and move to next byte (on next line)
            break;
         }
         bool isSet = (byte << j) & 0x80;
         if(isSet == set) {
            streak++;
         } else {
            if(!first) {
               Serial.print(F(", "));
            } else {
               first = false;
            }
            Serial.print(F("0x"));
            Serial.print(streak, HEX);
            
            streak = 1;
            set = isSet;
         }
      
      }

   }

   Serial.print(F(", 0x"));
   Serial.print(streak, HEX);
   Serial.println(F("\n};"));
}

